export function CartItem({ date }) {

    return <div className="col-md-6">
        <h1>users</h1>
        <div className="row">
            <div className="col-md-6">
                <div className="row">
                    {
                        date.map(elm => {
                            return <CartItem
                                {...elm}
                            />

                        })
                    }
                </div>

            </div>

        </div>
    </div>
}


